import React from "react";
import css from "./style.module.css";
class OrderPage extends React.Component {
  state = {
    orders: [],
    loading: false,
  };
  componentDidMount() {
    this.setState({ loading: true });
    axios
      .get("./orders.json")
      .then((response) => {
        //objectyg massiv bolgoj oruulah
        let arr = Object.entries(response.data).reverse();

        const lastOrder = arr[0][1];
        console.log(lastOrder);
        this.setState({
          ingredients: lastOrder.ingredients,
          totalPrice: lastOrder.price,
          latCustomerName: lastOrder.address.name,
        });
        console.log(this.state.latCustomerName);
      })
      .catch((err) => console.log(err))
      .finally(() => {
        this.setState({ loading: false });
      });
  }
  render() {
    return <div></div>;
  }
}
export default OrderPage;
